import React from 'react';
import HeadBar from './HeadBar'
import questions from './data.js'
import QuizContainer from './QuizContainer'

function App() {
  return (
    <div className="app container">
      <h1>Lutrivia</h1>
      <HeadBar />
      <QuizContainer questions={questions}/>
    </div>
  );
}

export default App;
